import React, {Component} from 'react';

class Post extends Component{

    state = {
        id: null
    }
    componentDidMount(){
        let id = this.props.match.params.post_id;
        console.log(id);
        this.setState({
            id: id
        })
    }
    render(){
        return(
        <div className="container">
            <h4>{this.state.Post}</h4>
        </div>
        )
    }
}

export default Post;
